import React from "react";

class AddContact extends React.Component {
    render() {
        return (
            <div className="ui ">
                <button className="ui right labeled icon button">
                    <i class="right arrow icon"></i>
                    Add Contact
                </button>
            </div>
        );
    }
}

export default AddContact;
